# OEIS sequence: A181957

def aupton(nn):
    alst = [10]
    R = {0: set(range(1, 10))}   # R[n] is set reachable using n ops
    for n in range(1, nn):
        R[n] = set()
        for i in range((n+1)//2):
            for a in R[i]:
                for b in R[n-1-i]:
                    R[n].update([a+b, a*b])
        k = 10
        while k in R[n]: k += 1  # n.b. R[n-1] <= R[n] due to * by 1
        alst.append(k)
    return alst
print(aupton(9)) # _Michael S. Branicky_, Oct 19 2021

